function spostamin(min){
	var selMin = $('#minuti').val();
	var selOra = $('#ora').val();
	//setta la select o il form a + o - min 
	if('55' === selMin && parseInt(min)>0){
		$('#ora').val(parseInt(selOra)+1);
		$('#minuti').val('00');
	}else if('00' === selMin && parseInt(min)<0){
		$('#ora').val(parseInt(selOra)-1);
		$('#minuti').val('55');
	}else{
		var nextMin = parseInt(selMin) + parseInt(min);
		if(nextMin == 5){
			$('#minuti').val('05');
		}else if( nextMin == 0){
			$('#minuti').val('00');
		}else{
			$('#minuti').val(parseInt(selMin) + parseInt(min));
		}
	}
	if("09" == $('#ora').val() && "00" == $('#minuti').val()){
		$('#indietro').attr("disabled", "disabled").css("opacity", ".5");
	}else{
		$('#indietro').removeAttr("disalbed").css("opacity", "1");
	}
	if("20" == $('#ora').val() && "55" == $('#minuti').val()){
		$('#avanti').attr("disabled", "disabled").css("opacity", ".5");
	}else{
		$('#avanti').removeAttr("disalbed").css("opacity", "1");
	}
	
	ricaricaGrigliaTimeAndSales();
}
</script>

